import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Signin from './pages/SignUp';
import './css/home.css';
import signup from './pages/Login';

const App = () => {

  return (

    <Router>
      <Routes>
        <Route path="/register" element={<SignUp/>} />
        <Route path="/addfacture/factures" element={<Voirallfacture />} />

        <Route  path="/" element={<Login/>} />


        <Route path="/addfacture" element={<Home/>} />

        <Route path="/facture/:id" element={<Updateuser   />} />

        <Route path="/facture" element={<Facture/>} />
        <Route path="/showfacture" element={<Showfacture/>} />

        <Route path="/addfacture/factures/:id" element={<Updatefacture   />} />

      </Routes>
    </Router>
  );
};

export default App;
